import React from 'react';
import text869 from './itresse.png';
import './Logo.css';

const Logo = () => {
return (


<div className="">
  <nav className="flex justify-between items-center">
    <div className="ml5-l ml3 tl">
      <a href="./index.html" className="dib w-10-l w-30 pa1 mt3 grow-large img-abs border-box ">
        <img src={text869} className="dib  link white-90 " alt="Site Name"/>
     </a>
    </div>

  </nav>
</div>

);
}

export default Logo;
